// StudentRow.js

import React from 'react';
import FileList from './FileList'; // This should be the actual FileList component

const StudentRow = ({ student }) => {
  // Placeholder functions for handling grade and comment changes
  const handleGradeChange = (e) => {
    console.log('Grade changed to:', e.target.value);
    // Logic to update grade
  };

  const handleCommentChange = (e) => {
    console.log('Comment changed to:', e.target.value);
    // Logic to update comment
  };

  return (
    <div className="student-row">
      <div className="student-name">{student.name}</div>
      <FileList files={student.files} />
      <input
        type="text"
        value={student.grade}
        onChange={handleGradeChange}
        placeholder="Enter grade"
      />
      <input
        type="text"
        value={student.comment}
        onChange={handleCommentChange}
        placeholder="Enter comments"
      />
    </div>
  );
};

export default StudentRow;
